public class InnerDataSourceWebCrawlerConfigurationFactory(Action<Humidifier.Kendra.DataSourceTypes.WebCrawlerConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.WebCrawlerConfiguration>
{

    internal InnerDataSourceWebCrawlerAuthenticationConfigurationFactory AuthenticationConfigurationFactory { get; set; }

    internal InnerDataSourceProxyConfigurationFactory ProxyConfigurationFactory { get; set; }

    internal InnerDataSourceWebCrawlerUrlsFactory UrlsFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.WebCrawlerConfiguration Create()
    {
        var webCrawlerConfigurationResult = CreateWebCrawlerConfiguration();
        factoryAction?.Invoke(webCrawlerConfigurationResult);

        return webCrawlerConfigurationResult;
    }

    private Humidifier.Kendra.DataSourceTypes.WebCrawlerConfiguration CreateWebCrawlerConfiguration()
    {
        var webCrawlerConfigurationResult = new Humidifier.Kendra.DataSourceTypes.WebCrawlerConfiguration();

        return webCrawlerConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.WebCrawlerConfiguration result)
    {
        base.CreateChildren(result);

        result.AuthenticationConfiguration ??= AuthenticationConfigurationFactory?.Build();
        result.ProxyConfiguration ??= ProxyConfigurationFactory?.Build();
        result.Urls ??= UrlsFactory?.Build();
    }

} // End Of Class

